import React, { useState, useEffect } from 'react'

export default function App(){

  const [data, SetData] = useState([{}])


  useEffect(()=> {

    fetch("http://localhost:5000/members").then(

      res=> res.json()
    ).then(
        data=> {

          SetData(data)
          console.log(data)

        }
    )
  }, [])




  return (
    <div>
    {Array.isArray(data)
      ? data.map(element => {
          return <h2>{element}</h2>;
        })
      : null}
  </div>
  );
}
